	add("synchrocyclotron", "{\"term\":\"synchrocyclotron\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027synchro-\u0027 + \u0027cyclotron\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particle accelerator like a cyclotron, but which operates at variable frequency to account for the particles gaining energy, allowing for greater energies to be achieved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: The \u0027\u0027synchrocyclotron\u0027\u0027 was able to accelerate protons to sufficient energies that collisions with nuclei produce pions, the lightest particles that, we now know, are made from a single quark and an antiquark. — Frank Close, \u0027Particle Physics: A Very Short Introduction\u0027 (Oxford 2004, p. 50\", \"priority\":2}]}, \"synonyms\":{}}");

	add("synchromysticism", "{\"term\":\"synchromysticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027synchro-\u0027, referring to \u0027synchronicity\u0027, combined with \u0027mysticism\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The drawing of connections in modern culture (movies, music lyrics, historical happenings and esoteric knowledge); and finding connections that could be coming from the \u0026quot;collective unconscious mind\u0026quot;; and finding connections between occult knowledge (i.e. esoteric fraternities, cults and secret rituals), politics and mass media\", \"priority\":1}]}, \"synonyms\":{}}");

