	add("syncopation", "{\"term\":\"syncopation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|syncopate|ion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;!-- syncopations is readily attestable, but nonetheless unusual --\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The quality of a rhythm being somehow unexpected, in that it deviates from the strict succession of regularly spaced strong and weak beats in a mete\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The loss of sounds in the middle of a word\", \"priority\":3}]}, \"synonyms\":{}}");

	add("syncope", "{\"term\":\"syncope\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"\u0027syncope\u0027 from Ancient greek (to 1453) \u0027συγκοπή\u0027 from \u0027σύν\u0027 + \u0027κόπτω\u0027 (strike, cut off)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A loss of consciousness when someone faints, a swoon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027 Patrick O\u0027Brian, \u0027HMS Surprise\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the rapidly-whitening face, the miserable fixed smile, meant a \u0027\u0027syncope\u0027\u0027 within the next few bars\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The absence of a sound from the interior of a word, for example by changing cannot to can\u0027t or the pronunciation of placenames in -cester (e.g. Leicester) as -ster\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A missed beat or off-beat stress in music resulting in syncopation\", \"priority\":5}]}, \"synonyms\":{}}");

	add("syncretism", "{\"term\":\"syncretism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Latin \u0027syncretismus\u0027 from Ancient greek (to 1453) \u0027συγκρητισμός|lang\u003dgrc\u0027 () from \u0027συγκρητίζω|lang\u003dgrc\u0027 () from \u0027σύν|lang\u003dgrc\u0027 () (English \u0027syn-\u0027 + \u0027κρῆτες|lang\u003dgrc\u0027 () (English \u0027cretans\u0027 . Surface analysis is {{confix|syn|Crete|ism|lang\u003den}} “Crete joining together”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The reconciliation or fusion of different systems or beliefs (or the attempt at such fusion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fusion of different inflexional forms\", \"priority\":2}]}, \"synonyms\":{}}");

