	add("syndic", "{\"term\":\"syndic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027syndic\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A government official, a magistrate, especially one of the Chief Magistrates of Geneva\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1923\u0027\u0027, \u0027The Thousand Nights and One Night\u0027, translated by Powys Mathers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘To-morrow, after the midday prayer, mount an ass and make for the Habbānīyah quarter and there enquire for the house of the \u0027\u0027syndic\u0027\u0027 Barakah, known as Abū Shāmah\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An agent of a corporation, or of any body of people engaged in a business enterprise; an advocate or patron; an assignee\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In France, \u0027\u0027syndics\u0027\u0027 are appointed by the creditors of a bankrupt to manage the property\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The University of Cambridge has its \u0027\u0027syndics\u0027\u0027, who are chosen from the senate to transact special business, such as the regulation of fees, the framing of laws, etc\", \"priority\":6}]}, \"synonyms\":{}}");

	add("syndrome", "{\"term\":\"syndrome\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027συνδρομή\u0027 (concurrence of symptoms, concourse) from \u0027σύνδρομος\u0027 (running together) from \u0027συν-\u0027 (with) + \u0027δρόμος\u0027 (running, course)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A recognizable pattern of signs, symptoms and/or behaviours\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dBats host many high-profile viruses that can infect humans, including severe acute respiratory \u0027\u0027syndrome\u0027\u0027 and Ebola. A recent study explored the ecological variables that may contribute to bats’ propensity to harbor such zoonotic diseases by comparing them with another order of common reservoir hosts: rodents\", \"priority\":2}]}, \"synonyms\":{}}");

	add("synecdoche", "{\"term\":\"synecdoche\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027synecdoche\u0027 from Ancient greek (to 1453) \u0027συνεκδοχή\u0027 (receiving together)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A figure of speech that uses the name of a part of something to represent the whole\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0026quot;Martin Amis: Lightness at Midnight\u0026quot;, \u0027The Atlantic\u0027, Sep 2002\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Holocaust\u0026quot; can become a tired \u0027\u0027synecdoche\u0027\u0027 for war crimes in general\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The use of this figure of speech; synecdochy\", \"priority\":4}]}, \"synonyms\":{}}");

	add("synechism", "{\"term\":\"synechism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027συνεχής|lang\u003dgrc\u0027 () + \u0027-ism\u0027 coined by {{w|Charles Sanders Peirce}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tendency to regard things such as space, time, and law as continuous\", \"priority\":1}]}, \"synonyms\":{}}");

