	add("synemin", "{\"term\":\"synemin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An intermediate filament that localizes at the Z-disk and has been shown to bind to α-dystrobrevin, α-actinin, and desmin to act as a mechanical linker in transmitting force laterally throughout the tissue, especially between the contractile myofibrils and extracellular matrix\", \"priority\":1}]}, \"synonyms\":{}}");

