	add("synergy", "{\"term\":\"synergy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027συνεργία\u0027 (joint work, assistance, help) from \u0027συνεργός\u0027 (working together) from \u0027σύν\u0027 (together) + \u0027ἔργον\u0027 (work)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Behavior of a system that cannot be predicted by the behavior of its parts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Combined action; the combined healthy action of every organ of a particular system; as, the digestive synergy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An interaction between drugs where the effects are stronger than their mere sum\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Benefits resulting from combining two different groups, people, objects or processes\", \"priority\":4}]}, \"synonyms\":{}}");

